import React from "react";

const Card = () => <>
    {<img
        src="./Images/spiderman.jpg"
        alt="SpiderMan"
    />}
    <p>Spider-Man No Way Home</p>
    <button>
        <a href="https://freemovies360.cc/movie/spider-man-no-way-home-71326" rel="noreferrer" target="_blank">Watch Now</a></button>
</>;

export default Card;
